import { ReactComponent as WebDevelopmentIcon } from '../assets/icons/web-development.svg';
import { ReactComponent as LandingPageIcon } from '../assets/icons/landing-page.svg';
import { ReactComponent as SeoIcon } from '../assets/icons/seo.svg';
import { ReactComponent as EcommerceIcon } from '../assets/icons/ecommerce.svg';
import { ReactComponent as AdvancedLandingPageIcon } from '../assets/icons/advanced-landing-page.svg';
import { ReactComponent as WebAppIcon } from '../assets/icons/web-app.svg';
import { ReactComponent as SaasIcon } from '../assets/icons/saas.svg';
import { ReactComponent as EnterpriseWebIcon } from '../assets/icons/enterprise-web.svg';
import { ReactComponent as DigitalTransformationIcon } from '../assets/icons/digital - transformation.svg';

const badgeNames = ['Bronze', 'Silver', 'Gold', 'Platinum'];

export const assignRelativeBadges = (services) => {
  const sortedServices = [...services].sort((a, b) => {
    const priceA = parseFloat(
      a.price.replace('$', '').replace('+', '')
    );
    const priceB = parseFloat(
      b.price.replace('$', '').replace('+', '')
    );
    return priceA - priceB;
  });

  const tierSize = sortedServices.length;
  sortedServices.forEach((service, index) => {
    const badgeIndex = Math.floor(
      (index / (tierSize - 1)) * (badgeNames.length - 1)
    );
    service.badgeName = badgeNames[badgeIndex];
  });

  return sortedServices;
};

